(5, 1, '2023-06-04 09:55:59', '2023-06-04 09:55:59', '<!-- wp:paragraph -->\n<p>Chicken Tikka Masala is a popular Indian dish known for its marinated and grilled chicken cooked in a flavorful tomato-based sauce. Here\'s a recipe to help you prepare Chicken Tikka Masala:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ingredients:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>For the Chicken Tikka:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>500 grams boneless chicken, cut into bite-sized pieces.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1 cup plain yogurt</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>2 tablespoons lemon juice</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>2 teaspoons ginger paste</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>2 teaspoons garlic paste.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1 teaspoon turmeric powder</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1 teaspoon cumin powder</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1 teaspoon coriander powder</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1 teaspoon paprika or Kashmiri red chili powder (for color)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Salt to taste</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>2 tablespoons oil</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>For the Tikka Masala Sauce:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>2 tablespoons butter or oil</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1 large onion finely chopped.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>2 teaspoons ginger paste</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>2 teaspoons garlic paste.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>2 teaspoons garam masala</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1 teaspoon turmeric powder</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1 teaspoon cumin powder</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1 teaspoon coriander powder</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1 teaspoon paprika or Kashmiri red chili powder</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1 cup tomato puree</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>1 cup heavy cream</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Salt to taste</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Fresh cilantro leaves, chopped (for garnish)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Instructions:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In a bowl, combine the yogurt, lemon juice, ginger paste, garlic paste, turmeric powder, cumin powder, coriander powder, paprika or red chili powder, and salt. Mix well to form a smooth marinade.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Add the chicken pieces to the marinade and coat them thoroughly. Cover the bowl and let the chicken marinate in the refrigerator for at least 2 hours, or preferably overnight, to allow the flavors to develop.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Preheat your grill or broiler. If using a grill, thread the marinated chicken onto skewers. If using a broiler, place the chicken pieces on a baking sheet lined with aluminum foil.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Drizzle oil over the chicken pieces and cook them until they are charred and cooked through, turning them occasionally to ensure even cooking. The cooking time will vary depending on your grill or broiler, but it typically takes about 10-15 minutes.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>While the chicken is cooking, prepare the Tikka Masala sauce. Heat butter or oil in a large pan over medium heat.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Add the chopped onions and cook until they become soft and translucent.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Stir in the ginger paste and garlic paste and cook for an additional minute until fragrant.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Add garam masala, turmeric powder, cumin powder, coriander powder, and paprika or red chili powder. Cook the spices for a minute to toast them and release their flavors.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pour in the tomato puree and stir well to combine. Let the sauce simmer for about 5 minutes until it thickens slightly.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Reduce the heat to low and add the grilled chicken pieces to the sauce. Stir to coat the chicken evenly with the sauce.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Pour in the heavy cream and simmer for another 5 minutes, allowing the flavors to meld together. Adjust the salt according to your taste.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Garnish with freshly chopped cilantro leaves.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Serve the Chicken Tikka Masala hot with naan bread or steamed rice.</p>\n<!-- /wp:paragraph -->', 'Chicken Tikka Masala', '', 'publish', 'open', 'open', '', 'chicken-tikka-masala', '', '', '2023-06-04 12:46:24', '2023-06-04 12:46:24', '', 0, 'http://localhost/recepies/?p=5', 0, 'post', '', 0),
