(9, 1, '2023-06-04 10:44:07', '2023-06-04 10:44:07', '<!-- wp:paragraph -->\n<p>Mysore Bajji is a popular South Indian snack known for its spicy and flavorful taste. It is typically made with a batter of fermented lentils and spices. Here\'s a recipe to help you prepare Mysore Bajji:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>1 cup urad dal (split black gram)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1/4 cup rice flour</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 tablespoon semolina (optional, for extra crispiness)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 teaspoon cumin seeds</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 teaspoon fennel seeds</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1/2 teaspoon turmeric powder</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Salt to taste</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Water (as needed for batter consistency)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Oil (for deep frying)</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>For the filling:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>2 medium-sized onions, finely chopped</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>2-3 green chilies, finely chopped</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 tablespoon chopped cilantro leaves</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 teaspoon chaat masala</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Salt to taste</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>For serving:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Coconut chutney</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Tomato ketchup</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Instructions:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><!-- wp:list-item -->\n<li>Wash the urad dal thoroughly and soak it in water for at least 4-5 hours or overnight. Drain the water before grinding.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>In a blender or food processor, grind the soaked urad dal to a smooth paste. You may need to add a little water while grinding to achieve the right consistency.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Transfer the ground batter to a large bowl. Add rice flour, semolina (if using), cumin seeds, fennel seeds, turmeric powder, and salt. Mix well to combine all the ingredients and form a smooth batter. The batter should be thick and of pouring consistency.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Cover the bowl with a clean cloth and let the batter ferment in a warm place for 6-8 hours or overnight. Fermentation helps in achieving a light and crispy texture.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Once the batter is fermented, give it a gentle stir. If the batter seems too thick, you can add a little water to adjust the consistency.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>In a separate bowl, mix together the finely chopped onions, green chilies, cilantro leaves, chaat masala, and salt. This will be the filling for the Mysore Bajji.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Heat oil in a deep frying pan or kadai over medium heat.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Take a small portion of the batter using a spoon or your hands and drop it gently into the hot oil. You can shape it into a small round or oval shape.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Fry the bajjis in small batches, turning them occasionally, until they turn golden brown and crispy. Remove them from the oil using a slotted spoon and drain the excess oil on a paper towel.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Once all the bajjis are fried, make a small slit on one side of each bajji using a knife or spoon.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Stuff the prepared onion filling into the slit of each bajji. Repeat this for all the bajjis.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Serve the Mysore Bajjis hot with coconut chutney and tomato ketchup.</li>\n<!-- /wp:list-item --></ol>\n<!-- /wp:list -->', 'Mysore Bajji or Bonda', '', 'publish', 'open', 'open', '', 'mysore-bajji-or-bonda', '', '', '2023-06-05 04:59:03', '2023-06-05 04:59:03', '', 0, 'http://localhost/recepies/?p=9', 0, 'post', '', 0),
