em from the oil using a slotted spoon and drain the excess oil on a paper towel.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Once all the bajjis are fried, make a small slit on one side of each bajji using a knife or spoon.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Stuff the prepared onion filling into the slit of each bajji. Repeat this for all the bajjis.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Serve the Mysore Bajjis hot with coconut chutney and tomato ketchup.</li>\n<!-- /wp:list-item --></ol>\n<!-- /wp:list -->', 'Mysore Bajji or Bonda', '', 'inherit', 'closed', 'closed', '', '9-revision-v1', '', '', '2023-06-04 10:44:07', '2023-06-04 10:44:07', '', 9, 'http://localhost/recepies/?p=10', 0, 'revision', '', 0),
