(51, 1, '2023-06-04 15:37:51', '2023-06-04 15:37:51', '<!-- wp:paragraph -->\n<p>Mysore Bajji is a popular South Indian snack known for its spicy and flavorful taste. It is typically made with a batter of fermented lentils and spices. Here\'s a recipe to help you prepare Mysore Bajji:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>1 cup urad dal (split black gram)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1/4 cup rice flour</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 tablespoon semolina (optional, for extra crispiness)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 teaspoon cumin seeds</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 teaspoon fennel seeds</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1/2 teaspoon turmeric powder</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Salt to taste</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Water (as needed for batter consistency)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Oil (for deep frying)</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>For the filling:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>2 medium-sized onions, finely chopped</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>2-3 green chilies, finely chopped</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 tablespoon chopped cilantro leaves</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 teaspoon chaat masala</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Salt to taste</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>For serving:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Coconut chutney</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Tomato ketchup</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Instructions:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><!-- wp:list-item -->\n<li>Wash the urad dal thoroughly and soak it in water for at least 4-5 hours or overnight. Drain the water before grinding.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>In a blender or food processor, grind the soaked urad dal to a smooth paste. You may need to add a little water while grinding to achieve the right consistency.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Transfer the ground batter to a large bowl. Add rice flour, semolina (if using), cumin seeds, fennel seeds, turmeric powder, and salt. Mix well to combine all the ingredients and form a smooth batter. The batter should be thick and of pouring consistency.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Cover the bowl with a clean cloth and let the batter ferment in a warm place for 6-8 hours or overnight. Fermentation helps in achieving a light and crispy texture.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Once the batter is fermented, give it a gentle stir. If the batter seems too thick, you can add a little water to adjust the consistency.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>In a separate bowl, mix together the finely chopped onions, green chilies, cilantro leaves, chaat masala, and salt. This will be the filling for the Mysore Bajji.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Heat oil in a deep frying pan or kadai over medium heat.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Take a small portion of the batter using a spoon or your hands and drop it gently into the hot oil. You can shape it into a small round or oval shape.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Fry the bajjis in small batches, turning them occasionally, until they turn golden brown and crispy. Remove them from the oil using a slotted spoon and drain the excess oil on a paper towel.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Once all the bajjis are fried, make a small slit on one side of each bajji using a knife or spoon.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Stuff the prepared onion filling into the slit of each bajji. Repeat this for all the bajjis.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Serve the Mysore Bajjis hot with coconut chutney and tomato ketchup.</li>\n<!-- /wp:list-item --></ol>\n<!-- /wp:list -->', 'Mysore Bajji or Bonda', '', 'inherit', 'closed', 'closed', '', '9-revision-v1', '', '', '2023-06-04 15:37:51', '2023-06-04 15:37:51', '', 9, 'http://localhost/recepies/?p=51', 0, 'revision', '', 0),
(52, 2, '2023-06-04 16:47:13', '2023-06-04 16:47:13', '<!-- wp:paragraph -->\n<p>Boondi Laddu is a popular Indian sweet made during festivals and special occasions.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ingredients:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>Besan Flour - 2 cups</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Sugar - 2 cups</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Water - 1 cup</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Cardamom Powder - 1 tsp</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Ghee - 1 cup</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Oil - for frying</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Instructions:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><!-- wp:list-item -->\n<li>Mix besan flour with water to make a smooth batter.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Heat oil in a pan.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Hold boondi ladle with small round holes on top with one hand.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>With the other pour some batter all over the holes.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Tap gently till all batter has fallen into hot oil.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Fry till light golden brown.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Drain and keep aside.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Boil sugar with water till it reaches one string consistency.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Add cardamom powder and mix well.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Add the fried boondi and mix well.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Add ghee and mix well.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Shape into small balls.</li>\n<!-- /wp:list-item --></ol>\n<!-- /wp:list -->', 'Boondi laddu', '', 'publish', 'open', 'open', '', 'boondi-laddu', '', '', '2023-06-04 17:00:58', '2023-06-04 17:00:58', '', 0, 'http://localhost/recepies/?p=52', 0, 'post', '', 0),
