>Shape into small balls.</li>\n<!-- /wp:list-item --></ol>\n<!-- /wp:list -->', 'Boondi laddu', '', 'inherit', 'closed', 'closed', '', '52-revision-v1', '', '', '2023-06-04 16:47:13', '2023-06-04 16:47:13', '', 52, 'http://localhost/recepies/?p=53', 0, 'revision', '', 0),
