(59, 1, '2023-06-05 05:19:26', '2023-06-05 05:19:26', '<!-- wp:paragraph -->\n<p>Hyderabadi dum biryani is a flavorful and aromatic dish that originated in the city of Hyderabad, India. It is known for its unique cooking technique and the combination of fragrant spices and tender meat. Here\'s a general recipe to prepare Hyderabadi dum biryani:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ingredients: For the rice:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>2 cups basmati rice</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>4 cups water</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 bay leaf</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>2-3 green cardamom pods</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1-inch cinnamon stick</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Salt to taste</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>For the meat:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>500 grams chicken, mutton, or beef (cut into pieces)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 cup plain yogurt</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>2 tablespoons ginger-garlic paste</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 teaspoon red chili powder</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 teaspoon turmeric powder</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Salt to taste</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>For the biryani:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>2 large onions, thinly sliced</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 cup chopped mint leaves</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 cup chopped coriander leaves</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 teaspoon saffron strands (soaked in 2 tablespoons warm milk)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1/2 cup ghee (clarified butter) or vegetable oil</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 tablespoon rose water (optional)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 tablespoon kewra water (optional)</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Spices:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>2-3 green cardamom pods</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>2-3 cloves</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1-inch cinnamon stick</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 bay leaf</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 teaspoon shahi jeera (black cumin seeds)</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Instructions:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><!-- wp:list-item -->\n<li>Wash the basmati rice thoroughly and soak it in water for 30 minutes. Drain the rice and keep it aside.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>In a large pot, bring water to a boil. Add the soaked rice, bay leaf, green cardamom pods, cinnamon stick, and salt. Cook the rice until it is 70-80% cooked (parboiled). Drain the rice and set it aside.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Marinate the meat with yogurt, ginger-garlic paste, red chili powder, turmeric powder, and salt. Allow it to marinate for at least 30 minutes.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>In a separate pan, heat ghee or oil and add the sliced onions. Fry the onions until they turn golden brown and crispy. Remove half of the fried onions and set them aside for garnishing.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>In the same pan with the remaining onions, add the marinated meat along with the marinade. Cook on medium heat until the meat is partially cooked and the spices are well combined. Remove from heat.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Preheat your oven to 180°C (350°F) or prepare a stove-top dum cooking setup (placing a tawa/griddle under the pot for indirect heat).</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>In a heavy-bottomed pot or handi, layer half of the parboiled rice. Sprinkle half of the chopped mint leaves, coriander leaves, and the fried onions. Then add the partially cooked meat along with its gravy. Spread it evenly.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Layer the remaining rice on top, followed by the remaining mint leaves, coriander leaves, and fried onions. Drizzle the soaked saffron milk, rose water, and kewra water over the rice.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Cover the pot with a tight-fitting lid or seal it with aluminum foil to trap the steam. Place the pot in the preheated oven or on the stove-top dum cooking setup. Cook on low heat for about 30-40 minutes until the rice is fully cooked and the flavors have melded together.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Remove the pot from the heat and let it rest for 10-15 minutes without opening the lid. This allows the flavors to further develop.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Gently fluff the rice with a fork, ensuring not to break the rice grains.</li>\n<!-- /wp:list-item --></ol>\n<!-- /wp:list -->', 'Hyderabadi Dum Biryani', '', 'publish', 'open', 'open', '', 'hyderabadi-dum-biryani', '', '', '2023-06-05 05:19:27', '2023-06-05 05:19:27', '', 0, 'http://localhost/recepies/?p=59', 0, 'post', '', 0),
