(82, 3, '2023-06-05 14:45:22', '2023-06-05 14:45:22', '<!-- wp:paragraph -->\n<p>Semolina (Vermicelli) Upma, a popular variation of Upma made with vermicelli noodles:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<h2>Ingredients:</h2>\n<!-- /wp:html -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>1 cup vermicelli (semya)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>2 tablespoons oil or ghee</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 teaspoon mustard seeds</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 teaspoon cumin seeds</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 tablespoon split urad dal (split black gram)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 tablespoon chana dal (split chickpeas)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 medium-sized onion, finely chopped</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 green chili, chopped (adjust according to your spice preference)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1/4 cup carrots, finely chopped</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1/4 cup green peas (optional)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>8-10 curry leaves</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>2 cups water</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Salt to taste</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Fresh coriander leaves for garnishing</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Lemon wedges (optional)</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p><h2>Instructions:</h2></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><!-- wp:list-item -->\n<li>Heat oil or ghee in a pan or kadai over medium heat.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Add mustard seeds and let them splutter. Then add cumin seeds, urad dal, and chana dal. Sauté until the dals turn golden brown.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Add chopped onions, green chili, and curry leaves. Sauté until the onions become translucent.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Add the chopped carrots and green peas (if using). Stir-fry for a couple of minutes.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Meanwhile, in a separate saucepan, bring water to a boil.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>In another pan, dry roast the vermicelli over medium heat until it turns golden brown. Keep stirring to avoid burning.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Once the vermicelli is roasted, add it to the pan with the sautéed ingredients. Mix well to combine.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Slowly pour in the boiling water while stirring continuously.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Add salt to taste and mix well. Reduce the heat to low, cover the pan, and let it cook for a few minutes until the vermicelli is cooked and the water is absorbed. Stir occasionally to prevent sticking.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Once the Semolina Upma is cooked and has a fluffy texture, turn off the heat.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Garnish with fresh coriander leaves and serve hot. You can squeeze some lemon juice over the upma before serving for added flavor.</li>\n<!-- /wp:list-item --></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Enjoy your homemade Semolina Upma for a delicious and satisfying breakfast or snack!</p>\n<!-- /wp:paragraph -->', 'Vermicelli or Semya Upma', 'Semolina (Vermicelli) Upma, a popular variation of Upma made with vermicelli noodles', 'publish', 'open', 'open', '', 'semya-or-vermicelli-upma', '', '', '2023-06-05 16:07:17', '2023-06-05 16:07:17', '', 0, 'http://localhost/recepies/?p=82', 0, 'post', '', 0),
