l the dals turn golden brown.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Add chopped onions, green chili, and curry leaves. Sauté until the onions become translucent.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Add the chopped carrots and green peas (if using). Stir-fry for a couple of minutes.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Meanwhile, in a separate saucepan, bring water to a boil.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>In another pan, dry roast the vermicelli over medium heat until it turns golden brown. Keep stirring to avoid burning.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Once the vermicelli is roasted, add it to the pan with the sautéed ingredients. Mix well to combine.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Slowly pour in the boiling water while stirring continuously.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Add salt to taste and mix well. Reduce the heat to low, cover the pan, and let it cook for a few minutes until the vermicelli is cooked and the water is absorbed. Stir occasionally to prevent sticking.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Once the Semolina Upma is cooked and has a fluffy texture, turn off the heat.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Garnish with fresh coriander leaves and serve hot. You can squeeze some lemon juice over the upma before serving for added flavor.</li>\n<!-- /wp:list-item --></ol>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Enjoy your homemade Semolina Upma for a delicious and satisfying breakfast or snack!</p>\n<!-- /wp:paragraph -->', 'Vermicelli or Semya Upma', 'Semolina (Vermicelli) Upma, a popular variation of Upma made with vermicelli noodles', 'inherit', 'closed', 'closed', '', '82-revision-v1', '', '', '2023-06-05 14:58:01', '2023-06-05 14:58:01', '', 82, 'http://localhost/recepies/?p=90', 0, 'revision', '', 0),
(91, 1, '2023-06-05 15:00:58', '2023-06-05 15:00:58', '<!-- wp:paragraph -->\n<p>Here is a basic recipe for preparing Upma, a popular South Indian dish made from semolina (also known as rava or sooji):</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ingredients:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><!-- wp:list-item -->\n<li>1 cup semolina (rava/sooji)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>2 tablespoons oil or ghee</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 teaspoon mustard seeds</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 teaspoon cumin seeds</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 tablespoon urad dal (split black gram)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 tablespoon chana dal (split chickpeas)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 medium-sized onion, finely chopped</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1 green chili, chopped (adjust according to your spice preference)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1/4 cup carrots, finely chopped</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>1/4 cup green peas (optional)</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>8-10 curry leaves</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>2 cups water</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Salt to taste</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Fresh coriander leaves for garnishing</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Lemon wedges (optional)</li>\n<!-- /wp:list-item --></ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>Instructions:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><!-- wp:list-item -->\n<li>Heat oil or ghee in a pan or kadai over medium heat.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Add mustard seeds and let them splutter. Then add cumin seeds, urad dal, and chana dal. Sauté until the dals turn golden brown.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Add chopped onions, green chili, and curry leaves. Sauté until the onions become translucent.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Add the chopped carrots and green peas (if using). Stir-fry for a couple of minutes.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Meanwhile, in a separate saucepan, bring water to a boil.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Reduce the heat to low and slowly add the semolina to the pan with the sautéed ingredients. Stir continuously to avoid lumps.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Once the semolina is well coated with the oil and spices, slowly pour in the boiling water while stirring continuously.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Add salt to taste and mix well. Increase the heat to medium and let it cook for a few minutes until the water is absorbed and the semolina is cooked. Keep stirring occasionally.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Once the Upma is cooked and has a fluffy texture, turn off the heat.</li>\n<!-- /wp:list-item -->\n\n<!-- wp:list-item -->\n<li>Garnish with fresh coriander leaves and serve hot. You can squeeze some lemon juice over the Upma before serving for added flavor.</li>\n<!-- /wp:list-item --></ol>\n<!-- /wp:list -->\n\n<!-- wp:group {\"style\":{\"spacing\":{\"padding\":{\"top\":\"30px\",\"right\":\"30px\",\"bottom\":\"30px\",\"left\":\"30px\"}}},\"layout\":{\"inherit\":false}} -->\n<div class=\"wp-block-group\" style=\"padding-top:30px;padding-right:30px;padding-bottom:30px;padding-left:30px\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"width\":\"50%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:50%\"><!-- wp:query {\"queryId\":9,\"query\":{\"perPage\":2,\"pages\":0,\"offset\":0,\"postType\":\"post\",\"order\":\